const Icons = () => {
  return (
    <>
      <div className={Style.container}>
        <div className={Style.searchBar}>
          <TextField placeholder="Buscar" />
          <img src={Search} alt="Lupa de pesquisa" />
        </div>
        <Button>
          <NavLink className={Style.login__button} to="login">Login</NavLink>
        </Button>
        <Button>
          <NavLink className={Style.login__button} to="login">Login</NavLink>
